import React from "react";
import './Sobre.css'

function Sobre(){
    return(
        <section className="sobre">
            <h1>Sobre</h1>
            <img src="/imagens/nene.jpeg" id="foto"/>
            <p><h3>Duck Mendes<br/><br/>
            Meu nome é Duck e eu sou um hamster anão de 1 ano e 5 meses.
             </h3></p>
        </section>
        )
}

export default Sobre
